var FastPriorityQueue = require('fastpriorityqueue');

var N = 10000000;

var data = [];
for (var i = 0; i < N; i++) data[i] = {value: (Math.random()*1000)>>0};

var q = new FastPriorityQueue(compare);

function compare(a, b) {
    return a.value < b.value;
}

// for (i = 0; i < 1000; i++) q.add(data[i]);

console.time('fastpriorityqueue ['+N+' items]');
for (i = 0; i < N; i++) q.add(data[i]);
// console.timeEnd('push ' + N);
// console.time('pop ' + N);
for (i = 0; i < N; i++) q.poll();
console.timeEnd('fastpriorityqueue ['+N+' items]');
